import '../App.css'

const Homepage = () => {
    return (
        <>
            <img className="imgLogo" src={require(`../imagens/logo.png`)} height={707} width={707} alt='' />



            <div className='ret_homepage'>
                <img src={require('../imagens/retangulo_homepage.png')} alt='' />

                <h1>#8</h1>
                <div>
                <img src={require('../imagens/lana.png')} alt='' />
                </div>
            </div>


        </>
    );
}

export default Homepage;
